import { Link } from "react-router-dom"
import Cart from "./Cart"
import "./nav.css"
import { useEffect, useState } from "react";
function Nav(props){

const [no,setno] = useState("")
useEffect(()=>{
const localno = localStorage.getItem('cartdata');

  if(localno){const a = JSON.parse(localno);

     setno(a.length)}


},[])

return(
    <>
     <div className="nav"> 
     <div className="categorycon"><p className="navorder">Order here</p>
     <div className="navhovercon">
<div className="hoverchild">Cake</div>
<div className="hoverchild">Juice</div>
<div className="hoverchild">Food</div>
<div className="hoverchild">bubble tea</div>


     </div>

     </div>
     <Link  to ={{pathname:"/cart"}}><div className="cartcon"><div className="cartno">{no || ""}</div><img className="cartimg" src="/cart.jpg"></img></div></Link>

      <Link className="homelink" to={{ pathname: "/contact" }}><p className="contact">Contact us</p></Link>

     </div>
    </>
)
}
export default Nav;
